DROP PROCEDURE IF EXISTS `pro_getSequenceByName`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `pro_getSequenceByName`( IN sn varchar(64),IN amt numeric(16,0),OUT seqName varchar(64),OUT initValue numeric(16,0),OUT maxValue numeric(16,0),OUT currentValue numeric(16,0),OUT seqStep numeric(16,0), OUT tableCircleSize numeric(16,0))
BEGIN
	#Routine body goes here...
 DECLARE t_error INTEGER DEFAULT 0;  
 DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1; 

  SELECT * INTO seqName,initValue,maxValue,currentValue,seqStep, tableCircleSize FROM xw_sequence WHERE seq_name = sn FOR Update;
  UPDATE xw_sequence SET current_value = current_value + seqStep*amt WHERE seq_name = sn;

 IF t_error = 1 THEN  
     ROLLBACK;  
 ELSE  
 COMMIT;  
 END IF;  
END
;;
DELIMITER ;
